import React from "react";
import "./CustomButon.styles..css";
const CustomButton = ({ title, desiredClassName, children }) => (
  <button className={`MyButton ${desiredClassName}`}>
    {title}
    {children ? children : null}
  </button>
);
export default CustomButton;
